// OpenZeppelin Contracts (last updated v5.1.0) (token/ERC20/ERC20.sol)

pragma solidity ^0.8.28;

import "../../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../../node_modules/@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "../../node_modules/@openzeppelin/contracts/token/ERC20/extensions/ERC20Pausable.sol";
import "../../node_modules/@openzeppelin/contracts/token/ERC20/extensions/ERC20Permit.sol";
import "../../node_modules/@openzeppelin/contracts/token/ERC20/extensions/ERC20Votes.sol";


contract DodoCoin is ERC20, ERC20Burnable, Ownable , ERC20Pausable, ERC20Permit, ERC20Votes {

    uint256 public immutable MAX_SUPPLY = 1_000_000 * 10**decimals();
    uint256 public transferFee = 2; // Default fee: 2%

    constructor() ERC20("DodoCoin", "DoDo" ) ERC20Permit("DodoCoin") Ownable(msg.sender) {
        _mint(msg.sender, 100000 * 10**decimals());
    }

    function mint(address to, uint256 amount) public onlyOwner {
        require(totalSupply() + amount <= MAX_SUPPLY, "ERC20: Cannot mint beyond max supply");
        _mint(to, amount);
    }

    function burn(uint256 amount) public virtual override {
        _burn(_msgSender(), amount);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function setTransferFee(uint256 fee) public onlyOwner {
        require(fee <= 10, "ERC20: Fee too high"); // Max fee is 10%
        transferFee = fee;
    }

    // Override transfer function to include fee logic
    function transfer(address to, uint256 amount) public override returns (bool) {
        uint256 fee = (amount * transferFee) / 100; // Calculate fee
        uint256 amountAfterFee = amount - fee;

        _transfer(_msgSender(), to, amountAfterFee); // Transfer the amount after fee
        _transfer(_msgSender(), owner(), fee);       // Transfer the fee to the owner
        return true;
    }

    // Override transferFrom function to include fee logic
    function transferFrom(address from, address to, uint256 amount) public override returns (bool) {
        uint256 fee = (amount * transferFee) / 100; // Calculate fee
        uint256 amountAfterFee = amount - fee;

        _spendAllowance(from, _msgSender(), amount); // Adjust allowance
        _transfer(from, to, amountAfterFee);         // Transfer the amount after fee
        _transfer(from, owner(), fee);               // Transfer the fee to the owner
        return true;
    }

    function _update(address from, address to, uint256 value) internal override(ERC20, ERC20Pausable, ERC20Votes)
    {
        ERC20Pausable._update(from, to, value); // Handles pausable behavior
        ERC20Votes._update(from, to, value);    // Handles voting logic
    }

    function nonces(address owner) public view override(ERC20Permit, Nonces) returns (uint256)
    {
        return super.nonces(owner);
    }
}
